import './Map.css';
import { MapContainer, TileLayer, LayersControl} from 'react-leaflet';
import MovieSets from './Layers/MovieSets';
import Cities from './Layers/Cities';
import MarkerClusterGroup from 'react-leaflet-markercluster';



function Map() {

  return (
    <div className="Map">
      <MapContainer center={[52.52437, 13.41053]} zoom={13}>
        <LayersControl position="topright">
          <LayersControl.BaseLayer checked name="OpenStreetMap">
            <TileLayer
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
          </LayersControl.BaseLayer>
          <LayersControl.BaseLayer name="Black and White">
            <TileLayer
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
              url="https://tiles.wmflabs.org/bw-mapnik/{z}/{x}/{y}.png"
            />
          </LayersControl.BaseLayer>
        <LayersControl.Overlay name="Movie Sets">
        <MarkerClusterGroup>
          <MovieSets />
        </MarkerClusterGroup>
        </LayersControl.Overlay>
        <LayersControl.Overlay name="Cities">
        <Cities />
        </LayersControl.Overlay>
        </LayersControl>
      </MapContainer>
    </div>
  );
}

export default Map;
